import React, { Component } from "react";
import Item from "./subcomponents/item";

class Items extends Component {
  render() {
    return (
      <div className="items">
        {this.props.items.map(item => (
          <Item item={item} addToCartClick={this.props.onatcClick} />
        ))}
      </div>
    );
  }
}

export default Items;
